INSERT INTO `doctor_services` (`id`, `name`, `description`, `speciality`, `coverpic`, `benefits`, `updated_on`) VALUES
(2, 'Treatment of fractures & injuries in children', 'Fractures', 27, '7499432.jpg', 'One point solution', '2022-09-01 08:08:59'),
(3, 'Development Assessment', 'Assessment', 27, '7398246.jpg', 'One hour long session', '2022-09-01 08:32:37'),
(4, 'Viral Fever Treatment', 'Seasoned Consultation', 27, '5924024.jpg', 'Trust & Cure', '2022-09-01 08:35:40'),
(5, 'Attention Problems', 'Attention-deficit/hyperactivity disorder (ADHD) is a chronic condition that affects millions of children and often continues into adulthood.', 27, '4549739.jpg', 'Correcting problems, such as difficulty sustaining attention, hyperactivity and impulsive behavior.', '2022-10-02 08:12:50'),
(6, 'Speech Delay', 'A delay in speech development may be a symptom of many disorders, including mental retardation, hearing loss, an expressive language disorder, psychosocial deprivation, autism, elective mutism, receptive aphasia and cerebral palsy. Speech delay may be secondary to maturation delay or bilingualism.', 27, '447972.jpg', 'Improving communication so they will be able to express thoughts and feelings.\r\nEnabling them to speak so that others will understand what they are saying.\r\nPreparing them for school so that they can keep up with other children in learning.\r\nImproves vocal quality.', '2022-10-02 08:15:30'),
(7, 'Behavior Problem', 'Children sometimes argue, are aggressive, or act angry or defiant around adults. A behavior disorder may be diagnosed when these disruptive behaviors are uncommon for the child\'s age at the time, persist over time, or are severe.', 27, '4490783.jpg', 'Gives each child positive guidance and encouragement toward acceptable behaviour and encourage children to express themselves and their opinions. allows the children to undertake experiences that develop self-reliance and self-esteem. maintains at all times the dignity and rights of each child.', '2022-10-02 09:59:41'),
(8, 'Academic Challenges', 'Children might be finding that the work is too hard or boring, or they might not be getting the support they need. When you understand whatâs behind your childâs school problems, youâre better able to find the right strategies to address these problems.', 27, '7127011.jpg', 'Children are more focused', '2022-10-02 10:43:15'),
(9, 'Bedwetting', 'Your child\'s bladder may not be developed enough to hold urine produced during the night. During childhood, some kids don\'t produce enough anti-diuretic hormone (ADH) to slow nighttime urine production.', 27, '4674304.jpg', 'Your child still wets the bed after age 7. Your child starts to wet the bed after a few months of being dry at night. Bed-wetting is accompanied by painful urination, unusual thirst, pink or red urine, hard stools, or snoring.', '2022-10-02 10:48:24'),
(10, 'Nail Biting', 'Type of obsessive-compulsive disorder since the person has difficulty stopping. People often want to stop and make multiple attempts to quit without success. People with onychophagia cannot stop the behavior on their own, so it\'s not effective to tell a loved one to stop.', 27, '479670.jpg', 'It\'s also associated with attention deficit hyperactivity disorder (ADHD), separation anxiety, tic disorder, and other mental health problems.', '2022-10-02 10:52:25'),
(11, 'Learning Problems', 'Learning disorders involve an inability to acquire, retain, or broadly use specific skills or information, resulting from deficiencies in attention, memory, or reasoning and affecting academic performance. Affected children may be slow to learn names of colors or letters, to count, or to learn to read or write.', 27, '1685615.jpg', 'Assure your kid is not suffering from dyslexia, dysgraphia, dyscalculia, auditory processing disorder, language processing disorder, nonverbal learning disabilities, visual perceptual/visual motor deficit.', '2022-10-02 10:58:20'),
(12, 'Blood Pressure', 'The higher your blood pressure levels, the more risk you have for other health problems, such as heart disease, heart attack, and stroke.', 1, '9300256.jpg', 'How to control diet high in salt (sodium) or low in potassium.', '2022-10-02 11:12:47'),
(13, 'Blood Pressure', 'The higher your blood pressure levels, the more risk you have for other health problems, such as heart disease, heart attack, and stroke.', 2, '6792860.jpg', 'How to control diet high in salt (sodium) or low in potassium.', '2022-10-02 11:14:04'),
(14, 'Blood Sugar', 'A blood sugar level less than 140 mg/dL (7.8 mmol/L) is normal. A reading of more than 200 mg/dL (11.1 mmol/L) after two hours means you have diabetes. A reading between 140 and 199 mg/dL (7.8 mmol/L and 11.0 mmol/L) means you have prediabetes.', 1, '9718042.jpg', 'Correcting your sugar level', '2022-10-02 11:18:48'),
(15, 'Blood Sugar', 'A blood sugar level less than 140 mg/dL (7.8 mmol/L) is normal. A reading of more than 200 mg/dL (11.1 mmol/L) after two hours means you have diabetes. A reading between 140 and 199 mg/dL (7.8 mmol/L and 11.0 mmol/L) means you have prediabetes.', 2, '8915112.jpg', 'Correcting your sugar level', '2022-10-02 11:19:37'),
(16, 'Thyroid disorders', 'The two main types of thyroid disease are hypothyroidism and hyperthyroidism. Both conditions can be caused by other diseases that impact the way the thyroid gland works. Conditions that can cause hypothyroidism include: Thyroiditis: This condition is an inflammation (swelling) of the thyroid gland.', 1, '6191410.jpeg', 'Your thyroid makes hormones that help control many vital functions of your body. When your thyroid doesn\'t work properly, it can impact your entire body. If your body makes too much thyroid hormone, you can develop a condition called hyperthyroidism.', '2022-10-02 11:22:25'),
(17, 'Thyroid disorders', 'The two main types of thyroid disease are hypothyroidism and hyperthyroidism. Both conditions can be caused by other diseases that impact the way the thyroid gland works. Conditions that can cause hypothyroidism include: Thyroiditis: This condition is an inflammation (swelling) of the thyroid gland.', 2, '7910914.jpeg', 'Your thyroid makes hormones that help control many vital functions of your body. When your thyroid doesn\'t work properly, it can impact your entire body. If your body makes too much thyroid hormone, you can develop a condition called hyperthyroidism.', '2022-10-02 11:22:34'),
(18, 'Urinary tract infection', 'Frequent urination. Feeling the need to urinate despite having an empty bladder. Bloody urine. Pressure or cramping in the groin or lower abdomen.', 1, '4125805.jpg', 'Antibiotics usually are the first line treatment for urinary tract infections. Which drugs are prescribed and for how long depend on your health condition and the type of bacteria found in your urine', '2022-10-02 11:29:10'),
(19, 'Urinary tract infection', 'Frequent urination. Feeling the need to urinate despite having an empty bladder. Bloody urine. Pressure or cramping in the groin or lower abdomen.', 2, '1007184.jpg', 'Antibiotics usually are the first line treatment for urinary tract infections. Which drugs are prescribed and for how long depend on your health condition and the type of bacteria found in your urine', '2022-10-02 11:29:13'),
(20, 'Chest infection', 'Chest infections are common, especially after a cold or flu during autumn and winter. Although most are mild and get better on their own, some can be serious or even life-threatening.', 1, '2529382.jpg', 'Care for patients with breathing problems, lung disease, cancer, emphysema, asthma and chronic obstructive pulmonary disease (COPD) and other respiratory disorders.', '2022-10-02 11:32:42'),
(21, 'Chest infection', 'Chest infections are common, especially after a cold or flu during autumn and winter. Although most are mild and get better on their own, some can be serious or even life-threatening.', 2, '678274.jpg', 'Care for patients with breathing problems, lung disease, cancer, emphysema, asthma and chronic obstructive pulmonary disease (COPD) and other respiratory disorders.', '2022-10-02 11:32:50'),
(22, 'COVID Treatment', 'Some of the primary symptoms to look for in a Covid 19 infected person are fever, dizziness, breathlessness, headache, dry cough ( eventually result in phlegm) and in a few cases loss in smell and taste. A few cases have also reported diarrhoea and fatigue.', 1, '1414246.jpg', 'Dr has treated more than thousand plus patients successfully.', '2022-10-02 11:37:51'),
(23, 'COVID Treatment', 'Some of the primary symptoms to look for in a Covid 19 infected person are fever, dizziness, breathlessness, headache, dry cough ( eventually result in phlegm) and in a few cases loss in smell and taste. A few cases have also reported diarrhoea and fatigue.', 2, '3013047.jpg', 'Dr has treated more than thousand plus patients successfully.', '2022-10-02 11:38:00'),
(24, 'Tropical Fever', 'These fevers include Dengue, Malaria, Scrub Typhus, Leptospirosis, Typhoid fever and some other fevers leading to very high morbidity and mortality.', 2, '391875.jpg', 'Drs has treated more than 10,000 patients successfully.', '2022-10-02 11:40:37'),
(25, 'Tropical Fever', 'These fevers include Dengue, Malaria, Scrub Typhus, Leptospirosis, Typhoid fever and some other fevers leading to very high morbidity and mortality.', 1, '8247953.jpg', 'Drs has treated more than 10,000 patients successfully.', '2022-10-17 14:18:43'),
(26, 'Cholesterol', 'High cholesterol is when you have too much of a fatty substance called cholesterol in your blood. It\'s mainly caused by eating fatty food, not exercising enough, being overweight, smoking and drinking alcohol. It can also run in families. You can lower your cholesterol by eating healthily and getting more exercise.', 1, '4602451.jpg', 'Reduce cholesterol level', '2022-10-02 12:06:28'),
(27, 'Cholesterol', 'High cholesterol is when you have too much of a fatty substance called cholesterol in your blood. It\'s mainly caused by eating fatty food, not exercising enough, being overweight, smoking and drinking alcohol. It can also run in families. You can lower your cholesterol by eating healthily and getting more exercise.', 2, '7120742.jpg', 'Reduce cholesterol level', '2022-10-02 12:06:34'),
(28, 'Managing Stress', 'Emotional problems (depression, anxiety, anger, grief, guilt, low self-esteem) Taking care of an elderly or sick family member. Traumatic event, such as a natural disaster, theft, rape, or violence against you or a loved one.', 11, '9358495.jpg', 'Preventing and managing long-term stress can lower your risk for other conditions â like heart disease, obesity, high blood pressure, and depression.', '2022-10-02 12:35:02'),
(29, 'Management of depression', 'The persistent feeling of sadness or loss of interest that characterises major depression can lead to a range of behavioural and physical symptoms. These may include changes in sleep, appetite, energy level, concentration, daily behaviour or self-esteem. Depression can also be associated with thoughts of suicide.', 11, '2855486.jpg', 'A depression treatment plan helps you to feel motivated to be happy again. At the most basic level, treatment can stabilize someone who has suicidal thoughts and provides them with the support and tools they need. Treating severe depression is just as critical as treating any other health concern', '2022-10-02 12:39:13'),
(30, 'Improving Vision', 'Middle-aged adults will begin to notice slight changes in their vision which can progress over time. Beginning in the early to mid-40s, many adults may start to have problems seeing clearly at close distances, especially when reading and working on the computer.', 11, '1485625.jpg', 'Improve quality of life', '2022-10-02 12:40:37'),
(31, 'Curing Allergies', 'OTC and prescription medications that may relieve symptoms. Avoiding allergy triggers or reducing contact with them can help prevent allergic reactions. Over time, immunotherapy may reduce the severity of allergic reactions.', 11, '3770551.jpg', 'educe responses to allergic triggers that precipitate symptoms in the short term and to decrease inflammatory response and prevent development of persistent disease in the long term.', '2022-10-02 12:43:25'),
(32, 'Childhood asthma', 'Frequent coughing that worsens when your child has a viral infection, occurs while your child is asleep or is triggered by exercise or cold air.', 11, '6135133.jpg', 'Right treatment, you and your child can keep symptoms under control and prevent damage to growing lungs.', '2022-10-02 12:45:26'),
(33, 'Removal of warts', 'Warts are caused by an infection with the human papilloma virus (HPV). The virus causes an excess amount of keratin, a hard protein, to develop in the top skin layer (epidermis). The extra keratin produces the rough, hard texture of a wart.', 11, '6135257.jpg', 'Prevent your warts from spreading to other people or other parts of your body.', '2022-10-02 12:47:12'),
(34, 'Gynecological troubles', 'Heavy periods or abnormal bleeding. Pelvic pain. Uterine fibroids. Endometriosis. Vaginal discharge.', 11, '2899286.png', 'Involves treating women who are not pregnant.', '2022-10-02 12:48:56'),
(35, 'Arthritis Cure', 'Treatment of arthritis could include rest, occupational or physical therapy, hot or cold compresses, joint protection, exercise, drugs, and sometimes surgery to correct joint damage.', 11, '8625046.jpg', 'Treatments can reduce pain and help you move better.', '2022-10-02 12:50:31'),
(36, 'Kidney Stones', 'Kidney stones form when your urine contains more crystal-forming substances â such as calcium, oxalate and uric acid â than the fluid in your urine can dilute.', 11, '9035960.jpg', 'Your doctor may give you a medication to help pass your kidney stone.', '2022-10-02 12:52:16'),
(37, 'Kidney Stones', 'Kidney stones form when your urine contains more crystal-forming substances â such as calcium, oxalate and uric acid â than the fluid in your urine can dilute.', 12, '761602.jpg', 'Your doctor may give you a medication to help pass your kidney stone.', '2022-10-02 13:05:36'),
(38, 'Prostrate', 'Prostatitis is a disorder of the prostate gland usually associated with inflammation. Prostatitis often causes painful or difficult urination, as well as pain in the groin, pelvic area or genitals.', 12, '2407763.jpg', 'The prostate\'s main function is producing semen, a fluid that nourishes sperm and helps it travel. Massaging the prostate encourages the prostate ducts to empty seminal fluid, which may have certain health benefits.', '2022-10-02 13:10:31'),
(39, 'UTI', 'Testing may involve a cystoscopy, a CT scan of the urinary tract, and a urine culture. Frequent infections are usually treated with a lower dose of antibiotics taken for a longer period of time.', 12, '947708.jpg', 'Treatment for UTIs is generally antibiotics, which get rid of the infection. You can also take over-the-counter pain medicine if you want. Antibiotics are usually quick and effective â most symptoms go away within a day or 2 of taking medicine. But be sure to finish all of your medicine, even if your symptoms go away.', '2022-10-02 13:13:37'),
(40, 'Kidney Cancer', 'RCC usually starts in the lining of tiny tubes in the kidney called renal tubules. RCC often stays in the kidney, but it can spread to other parts of the body, most often the bones, lungs, or brain.', 12, '7395055.jpg', 'Surgery is most common treatment for kidney cancerâmost people with early stage cancer (stages 1, 2, and 3) can be cured with surgery. In a radical nephrectomy, the entire kidney is removed. If needed, the surrounding tissues and lymph nodes may also be removed.', '2022-10-02 13:16:55'),
(41, 'Prostate cancer', 'Burning or pain during urination. Difficulty urinating, or trouble starting and stopping while urinating. More frequent urges to urinate at night. Loss of bladder control.', 12, '436477.jpg', 'Most prostate cancers are diagnosed with early screening measures and are curable, the average long-term prognosis for prostate cancer is quite encouraging.', '2022-10-02 13:20:01'),
(42, 'BPH Cure', 'Treatment for BPH has long been medications and procedures, such as lasers or an electric loop, which burn the prostate from the inside out. But, now, a relatively new convective water therapy treatment uses steam to make the prostate smaller.', 12, '3739622.jpg', 'Convective water therapy treatment uses steam to make the prostate smaller.', '2022-10-02 13:22:38'),
(43, 'Bladder Cancer', 'Having to urinate more often than usual. Pain or burning during urination. Feeling as if you need to go right away, even when your bladder isn\'t full. Having trouble urinating or having a weak urine stream. Having to get up to urinate many times during the night', 12, '3436991.jpg', 'Bladder cancer treatment may include: Surgery, to remove the cancer cells. Chemotherapy in the bladder (intravesical chemotherapy), to treat cancers that are confined to the lining of the bladder but have a high risk of recurrence or progression to a higher stage.', '2022-10-02 13:27:00'),
(44, 'Pediatric urology', 'Back and/or Groin Pain. Oftentimes back and groin pain are overlooked, or attributed to other causes such as muscle strains. Blood in the Urine. Frequent Urination. Painful Urination. Uncontrolled Urine Leakage.', 12, '1403460.jpg', 'Get rid of urology kids in children', '2022-10-02 13:31:19'),
(45, 'Male fertility', 'The best way to improve sperm count for successful fertility is to see your urologist. Your urologist will allow you to receive a proper diagnosis, better understand how your hormones play a part in your sperm production, and will give you a semen analysis to find out what\'s going on.', 12, '1203094.jpg', 'Urologist who specializes in male reproductive health.', '2022-10-02 13:33:49'),
(46, 'Renal Transplant', 'Surgery done to replace a diseased kidney with a healthy kidney from a donor. The kidney may come from a deceased organ donor or from a living donor. Family members or others who are a good match may be able to donate one of their kidneys. This type of transplant is called a living transplant.', 12, '9049217.jpg', 'Most kidney transplant patients live longer. Most patients enjoy a better quality of life. No longer need dialysis.', '2022-10-02 13:36:30'),
(47, 'Balance Diet', 'Eat a balanced diet of fruit and vegetables, lean protein such as tofu or salmon, whole grains (oatmeal or quinoa are great picks), and healthy fats such as avocado and olive oil.', 49, '7715215.jpg', 'Energy you need to keep active throughout the day. nutrients you need for growth and repair, helping you to stay strong and healthy and help to prevent diet-related illness, such as some cancers.', '2022-10-02 14:01:14'),
(48, 'Dietary decisions', 'Every day, eat a combination of different foods including whole grains such as wheat, maize and rice, legumes like lentils and beans, fruit and vegetables.', 49, '2837611.jpg', 'Prevent certain health conditions like heart disease and cancer, and it can lower your cholesterol.', '2022-10-02 14:02:53'),
(49, 'Food & Nutrition Choices', 'Emphasizes fruits, vegetables, whole grains, and fat-free or low-fat milk and milk products. Includes a variety of protein foods such as seafood, lean meats and poultry, eggs, legumes (beans and peas), soy products, nuts, and seeds. Is low in added sugars, sodium, saturated fats, trans fats, and cholesterol.', 49, '3852281.jpg', 'It can prevent certain health conditions like heart disease and cancer, and it can lower your cholesterol. It can give you more energy, help you focus, and improve your mood. It can also help you lose weight or stay at a healthy weight.', '2022-10-02 14:05:24'),
(50, 'Health Conditions', 'Medical condition means a health impairment resulting from a disease or injury, including a psychiatric disease.', 49, '6096138.jpg', 'Guidance navigating food allergies, sensitivities, weight gain, self-image and overall nutritional understanding.', '2022-10-02 14:06:54'),
(51, 'Healthy Lifestyle', 'Good nutrition, daily exercise and adequate sleep are the foundations of healthy living. A healthy lifestyle keeps you fit, energetic and at reduced risk for disease', 49, '3304783.jpg', 'A healthy lifestyle is a way of living that lowers the risk of being seriously ill.', '2022-10-02 14:07:56'),
(52, 'Recover Illness', 'A healthy diet, regular exercise, sleep and social support can relieve or manage the symptoms of illness or injury and help improve recovery.', 49, '9198117.jpg', 'Dietician make a huge difference for recovery from illness.', '2022-10-02 14:09:50'),
(53, 'Recover from Surgery', 'Eating well helps you recover faster, increases your energy levels, and prevents constipation and fatigue after surgery.', 49, '8446568.jpg', 'Making good food choices, your body can recover more steadily, allowing you to heal more quickly so you can return to your regular activities.', '2022-10-02 14:11:36'),
(54, 'Treat Clinical Condition', 'Therapy that eases the symptoms without addressing the basic cause of the disease.', 49, '9402607.png', 'Hospital patients and the elderly in nursing care facilities by determining their nutritional needs.', '2022-10-02 14:13:12'),
