(63, 'Anger Management', 'Counselors work collaboratively with you to address underlying anger issues and their causes, while also helping you reach healthy behavioral goals. Psychiatrist. Like psychotherapists, psychiatrists can help administer therapies for mental health treatment.', 7, '5907875.jpg', 'Helps recognize frustrations early and learn to manage the anger productively. It helps identify the situations or things that induce anger, thereby, preventing outbursts of rage and helping achieve better anger control.', '2022-10-03 06:54:06'),
(64, 'Anxiety Issues', 'It can be an effective treatment for anxiety. Cognitive behavioral therapy (CBT) is the most effective form of psychotherapy for anxiety disorders.', 7, '6120411.jpg', 'A psychiatrist can be a great help to those who are experiencing various levels of anxiety. In order for the treatment process to work, it is essential to have an open mind and listen closely to the psychiatrist for their guidance and direction.', '2022-10-03 06:55:40'),
(65, 'Child psychiatry', 'There are a variety of reasons why you should take your child to see a child psychiatrist. For instance, if you suspect that your child is suffering from a psychological disorder such as: anxiety disorders, clinical depression, obsessive and compulsive disorder, eating disorders, manic depression, etc.', 7, '7635703.jpg', 'Bedwetting (when already night trained) Frequent temper tantrums. Separation anxiety and clinginess. Excessive anxiety and fearfulness. Language regression (using âbaby talkâ)', '2022-10-03 07:08:27'),
(66, 'Depression', 'A group of conditions associated with the elevation or lowering of a person\'s mood, such as depression or bipolar disorder', 7, '9961440.jpg', 'Early detection, intervention, and appropriate treatment can promote remission, prevent relapse, and reduce the emotional and financial burden of the disease. depressive symptoms through medication or psychotherapy, eventually culminating in remission or absence of all residual symptoms.', '2022-10-03 07:09:49'),
(67, 'Headache', 'Headaches can be a common symptom â and sometimes a good indicator â of an anxiety disorder, particularly generalized anxiety disorder, or GAD. And chronic co-occurring headaches can make functioning even more difficult for someone with an anxiety disorder.', 7, '1152886.jpeg', 'Often overlooked is the high prevalence of psychiatric comorbidities associated with migraine, such as depression, anxiety and post-traumatic stress disorder.', '2022-10-03 07:11:44'),
(68, 'Mental Health', 'Psychiatrists are best consulted when a person is undergoing severe cases of mental illness. This is evident through extreme fluctuations in mood, behaviour and an unusual pattern of disruptions in daily living due to mental health issues.', 7, '4947540.png', 'Seeing a psychiatrist can provide clarity, assess your physical health, provide opportunities for personal growth, and improve the overall quality of your life.', '2022-10-03 07:12:50'),
(69, 'Sexual Problems', 'Sexual dysfunction can be any problems that prevent a person or couple from experiencing satisfaction from sexual activity. Some 43% of women and 31% of men report some degree of sexual dysfunction.', 7, '7579084.jpg', 'Psychiatrists can help deal with the underlying trauma and fear of sex, which will greatly help alleviate the symptoms of the condition.', '2022-10-03 07:25:05'),
(70, 'Substance Use Disorders', 'A substance use disorder (SUD) is a mental disorder that affects a person\'s brain and behavior, leading to a person\'s inability to control their use of substances such as legal or illegal drugs, alcohol, or medications. Symptoms can range from moderate to severe, with addiction being the most severe form of SUDs.', 7, '9204797.jpg', 'Certain mental disorders are established risk factors for developing a substance use disorder. It is commonly hypothesized that individuals with severe, mild, or even subclinical mental disorders may use drugs as a form of self-medication.', '2022-10-03 07:26:37'),
(71, 'Depression', 'A group of conditions associated with the elevation or lowering of a person\'s mood, such as depression or bipolar disorder', 55, '1706235.jpg', 'Early detection, intervention, and appropriate treatment can promote remission, prevent relapse, and reduce the emotional and financial burden of the disease. depressive symptoms through medication or psychotherapy, eventually culminating in remission or absence of all residual symptoms.', '2022-10-03 07:38:29'),
(72, 'Career Counselling', 'Career counseling is a service that helps people begin, change, or advance their careers. It can include one-on-one conversations between a counselor and a career seeker, as well as assessments, activities, and projects designed to help career seekers make the most of their strengths.', 55, '2779275.png', 'Determining strengths, interests and values, Setting direction and goals, Understanding the world of work, Identifying options and choices, Enhancing your personal brand.', '2022-10-03 07:51:21'),
(73, 'Child Psychologist', 'A child psychologist is a mental health specialist who performs psychological tests and several types of treatment to help teenagers and adults how to deal with problems in their personal lives, in their relationships, and with their mental health challenges.', 55, '428008.jpg', 'Explore ideas and emotions in a safe space, provide new perspectives, identify and eliminate bad habits, help with the future, and change the brain', '2022-10-03 07:52:56'),
(74, 'Leadership Training', 'The psychologist as coach will help the person to greatly develop their thinking and understanding. The models for working and reasoning used and developed throughout the coaching can even create a positive behavioral spiral that transforms the everyday life of the person being coached.', 55, '7040209.jpg', 'Help you emphasis on helping people develop their strengths rather than focusing on or punishing them for their weaknesses.', '2022-10-03 07:58:16'),
(75, 'PRP Therapy', 'RP treatment can help support wound healing in trauma and joint injury. The technique can address male pattern baldness, stimulate the growth of hair transplants and enhance other cosmetic procedures.', 8, '6628634.jpg', 'PRP is injected into targeted areas of the skin and then forms an environment which helps in growing collagen, regenerates the tissues and makes your skin smooth and tight. PRP softens wrinkles and creates skin texture and tone that is smoother, younger and better.', '2022-11-03 08:00:56'),
(76, 'Acne Treatment', 'Acne is a very common skin condition that causes pimples mostly on the face, forehead, chest, shoulders and upper back. There are a variety of causes including genetics, fluctuating hormone levels, stress, high humidity and using oily or greasy personal care products. Acne commonly affects teenagers but can occur at any age.', 8, '1202411.jpeg', 'Clear Acne free skin.', '2022-11-03 08:03:54'),
(77, 'Warts Treatment', 'A dermatologist may use one of the following treatments:  Cantharidin: A dermatologist may treat a wart in the office by \"painting\" it with cantharidin. Cantharidin causes a blister to form under the wart. In a week or so, you can return to the office and the dermatologist will clip away the dead wart.  Cryotherapy: For common warts in adults and older children, cryotherapy (freezing) is the most common treatment. This treatment is not too painful. It can cause dark spots in people who have dark skin. It is common to need repeat treatments.  Electrosurgery and curettage: Electrosurgery (burning) is a good treatment for common warts, filiform warts, and foot warts. Curettage involves scraping off (curetting) the wart with a sharp knife or small, spoon-shaped tool. These two procedures often are used together. The dermatologist may remove the wart by scraping it off before or after electrosurgery.  Excision: The doctor may cut out the wart (excision).  If the warts are hard-to-treat, the dermatologist may use one of the following treatments:  Laser treatment: Laser treatment is an option, mainly for warts that have not responded to other therapies. Before laser treatment, the dermatologist may numb the wart with an anesthetic injection (shot).  Chemical peels: When flat warts appear, there are usually many warts. Because so many warts appear, dermatologists often prescribe \"peeling\" methods to treat these warts. This means, you will apply a peeling medicine at home every day. Peeling medicines include salicylic acid (stronger than you can buy at the store), tretinoin, and glycolic acid.  Bleomycin: The dermatologist may inject each wart with an anti-cancer medicine, bleomycin. The shots may hurt. They can have other side effects, such as nail loss if given in the fingers.  Immunotherapy: This treatment uses the patientâs own immune system to fight the warts. This treatment is used when the warts remain despite other treatments. One type of immunotherapy involves applying a chemical, such as diphencyprone (DCP), to the warts. A mild allergic reaction occurs around the treated warts. This reaction may cause the warts to go away.', 8, '1861140.jpeg', 'You\'ll get rid of the warts', '2022-11-03 08:11:33'),
(78, 'Cosmetics', 'This may include hair loss, dark spots, or wrinkles. Many dermatologists are trained to administer cosmetic treatments, too. These include fillers, chemical peels, and laser hair removal.', 8, '3301031.jpeg', 'A dermatologist can treat skin issues that affect your appearance.', '2022-11-03 08:18:37'),
(79, 'Cerebral Palsy', 'Cerebral palsy is a group of disorders that affect movement and muscle tone or posture. It\'s caused by damage that occurs to the immature brain as it develops, most often before birth.  People with cerebral palsy can have problems swallowing and commonly have eye muscle imbalance, in which the eyes don\'t focus on the same object. They also might have reduced range of motion at various joints of their bodies due to muscle stiffness.Cerebral palsy can affect the whole body, or it might be limited primarily to one limb or one side of the body. The brain disorder causing cerebral palsy doesn\'t change with time, so the symptoms usually don\'t worsen with age. However, as the child gets older, some symptoms might become more or less apparent. And muscle shortening and muscle rigidity can worsen if not treated aggressively. Brain abnormalities associated with cerebral palsy might also contribute to other neurological problems.', 5, '8118055.jpg', 'Physical therapy and rehabilitation. A child with cerebral palsy usually starts these therapies in the first few years of life or soon after being diagnosed. Physical therapy is one of the most important parts of treatment. It involves exercises and activities that can maintain or improve muscle strength, balance, and movement. A physical therapist helps the child learn skills such as sitting, walking, or using a wheelchair. Other types of therapy include:\r\nOrthotic devices. Braces, splints, and casts can be placed on the affected limbs and can improve movement and balance. Other devices that can help with movement and posture include wheelchairs, rolling walkers, and powered scooters.\r\nAssistive devices and technologies. These include special computer-based communication machines, Velcro-fastened shoes, or crutches, which can help make daily life easier.\r\nMedication. Certain medications can relax stiff or overactive muscles and reduce abnormal movement. They may be taken by mouth, injected into affected muscles, or infused into the fluid surrounding the spinal cord through a pump implanted near the spinal cord. For children who have cerebral palsy and epilepsy (seizures), standard epileptic medications should be considered, but these medications may also have negative effects on the developing brain.\r\nSurgery. A child may need surgery if symptoms are severe. For instance, surgery can lengthen stiff, tightly contracted muscles. A surgeon can also place arms or legs in better positions or correct or improve an abnormally curved spine. Sometimes, if other treatments have not worked, a surgeon can cut certain nerves to treat abnormal, spastic movements. Before conducting surgery, it is important for a health care provider to assess the procedureâs benefits by carefully analyzing biomechanics of the joints and muscles.', '2022-11-04 07:42:33'),
(80, 'Arthritis', 'Arthritis is very common but is not well understood. Actually, âarthritisâ is not a single disease; it is an informal way of referring to joint pain or joint disease. There are more than 100 types of arthritis and related conditions. People of all ages, sexes and races can and do have arthritis, and it is the leading cause of disability in America. More than 50 million adults and 300,000 children have some type of arthritis. It is most common among women and occurs more frequently as people get older.Symptoms Following are the symptoms of Arthritis:  Swelling Pain Stiffness Decreased Range Of Motion Tiredness Skin Redness Loss of appetite  Common arthritis joint symptoms include swelling, pain, stiffness and decreased range of motion. Symptoms may come and go. They can be mild, moderate or severe. They may stay about the same for years but can progress or get worse over time. Severe arthritis can result in chronic pain, inability to do daily activities and make it difficult to walk or climb stairs. Arthritis can cause permanent joint changes. These changes may be visible, such as knobby finger joints, but often the damage can only be seen on X-ray. Some types of arthritis also affect the heart, eyes, lungs, kidneys and skin as well as the joints.', 5, '206427.jpg', 'Physical therapy involving exercises that help strengthen the muscles around the affected joint is a core component of arthritis treatment.', '2022-11-04 07:47:58'),
(81, 'Cupping Therapy', 'Cupping is a therapy used in traditional Chinese medicine (TCM) to remove stagnation and stimulate the flow of qi (chi).  Qi is the free flow of vital energy circulating through the body and the world around us, if the qi is disrupted or disturbed, it can create stagnation (blockages) or imbalances in the body.MECHANISM OF ACTION Through suction, the skin is drawn into the cup by creating a vacuum in the cup placed on the skin over the targeted area. The vacuum can be created either by the heating and subsequent cooling of the air in the cup, or via a mechanical pump. This increases the blood flow, loosens the fascia or connective tissue, and is thought to stimulate healing. It is similar to the way deep tissue massage can be used to break up scar tissue and reduce pain. TYPES OF CUPPING THERAPY Dry Cupping Fire Cupping Wet Cupping / Hijama Cupping Dynamic/ Moving Cupping', 5, '8873464.jpg', 'Pain Relief\r\nInflammation Reduction\r\nIncrease Blood Flow\r\nDeep-Tissue Massage\r\nMyofascial Release Relaxation\r\nRelease and Drain Excess Fluids and Toxins', '2022-11-04 09:15:20'),
(82, 'Electrotherapy', 'Paraffin wax is used in sub acute and chronic traumatic and inflammatory conditions. It is especially useful in R.A. Factors and arthritis of distal extremities since the wax envelops all the contours of a distal joint.  Short wave diathermy (SWD) has a wide range of applications in post traumatic and operative disorders and a number of inflammatory and painful conditions.  Ultrasound therapy (U.S.) helps relieve pain in different types of arthritis, bursitis, myalgia, tendinitis, synovitis, old scar tissues etc. ultrasound therapy is used in treatment of muscle spasms by providing deep heat micro-massage and electrical stimulation simultaneously.  Electro current therapy. The current types for electrotherapy and electro diagnostic applications include;  Faradic and galvanic current is used as unipolar or bipolar stimulation in peripheral nerve injuries, polyneuritis and in treating atrophy and helps venous and lymphatic drainage.  Transcutaneous electrical nerve stimulation (TENS) is based on pain gate control theory and is useful in treating acute and chronic pains.  Interferential therapy (IFT) finds its usage in pain relief by increased blood flow and muscle relaxation and is also used in urinary stress incontinence.  Direct current is particularly useful in treating hyperhydrosis athleteâs foot, rhinitis, decubitus, ulcers, plantar warts etc.  Electro physiological measurements determine whether a nerve is intact, partially damaged or completely interrupted.  LASER therapy provides significant pain relief in acute conditions and help in healing process also.  Continuous passive mobiliser is applied in treating diseases of the knee including joint distortion and contusion, synovectomy, menisectomy and patellectomy operations. It is of immense help in joint replacement surgeries of knee and hip joints.  Intermittent and static traction units are used in spinal nerve root impingement, degenerative disc diseases, spinal stenosis, and in muscle spasms of cervical and lumbar regions.  Moist heat packs helps in increasing blood flow, in muscle relaxation and in reducing pains.  Cryotherapy or cold packs helps in treatment of acute sprains and strains and in reducing pain, spasticity, muscle spasms and swelling.', 5, '1071890.jpeg', 'âIt will mohve you without painâ', '2022-11-04 09:18:28'),
(83, 'Orthopedic Physiotherapy', 'The treatment of Orthopaedic physiotherapy which heal your injuries or malfunctioning of the skeletal system and its related muscles, ligaments and joints. The treatment goal of the orthopaedic physiotherapist is to restore the body to its full functioning through pain relief as well as raising the joint range, and enhancing power, strength and flexibility.', 5, '4430494.jpeg', 'We have a highly equipped physiotherapy clinic with imported electrotherapy machines providing evidence-based physiotherapy practices. Our clinic has all the necessary equipment, modalities, and a sophisticated exercise and fitness regime. We also provide home-visit service treatments for our patients for paralysis, total hip replacement, sciatica, disc problem, back pain, cervical pain etc.', '2022-11-04 09:22:08'),
(84, 'Neuro Physiotherapy', 'Neurological Physiotherapy refers to the medical process that widens and starts the message transferring pathways with which the brain struggles to coordinate, thereby establishing new improved pathways with the help of different techniques and exercises. Evidence has shown that Neuro physiotherapy works and patients experienced great improvements in various health issues such as mental imbalance and lack of coordination between arms-hands or leg-foot.', 5, '1545389.jpeg', 'Our Neuro physiotherapy clinic in Gurgaon is equipped with the best equipments in the fields of High Intensity Class 4 Laser Therapy, Ultrasonic Therapy, Theraband Station, Shoulder Wheel, Radiofrequency, IFT, TENS, Traction Table, Kinesio Taping,  Stationary Cycle, Swiss Ball, Paraffin Wax Bath, Hot and Cold Packs, Balance Equipment and much more. Our highly advanced machines aid in the quick recovery of patients suffering from back pain, joint pain or any other abnormality in the body.', '2022-11-04 09:23:45'),
(85, 'Dry Needling', 'Dry needling is an advanced medical technique that aims at treating myofascial pain. In this technique, a dry needle is inserted in some specific muscle areas of the skin. These specific muscle areas are called trigger points and the technique is also known as âtrigger point dry needlingâ, and âintramuscular manual therapyâ. Dry needling is different from acupuncture.', 5, '641908.jpeg', 'Our team of best Dry Needling Physiotherapists in Gurgaon excels in restoring motion in and around the back which most people often ignore after an acute pain period. Our therapists also ensure that the problem does not return by providing regular exercise schedules.', '2022-11-04 09:25:41'),
(86, 'Sinus pain treatment', 'Pain in the face, ear or upper teeth, nasal drainage or congestion', 36, '4061113.jpeg', 'we make use of advanced medical technologies and equipment such as video camera system, fine vision binocular microscopes, flexible and rigid endoscopes which enable in making a more accurate diagnosis', '2022-11-04 09:28:29'),
(87, 'The Ears', 'Otolaryngologists are trained in both the medical and surgical treatment of hearing loss, ear infections, ear noise (tinnitus), and some cranial nerve disorders.  Otolaryngologists also manage congenital (birth) disorders of the outer and inner ear.', 15, '3998123.png', 'services we offer related to ear disorders include diagnosis and treatment for:\r\n\r\nDizziness\r\nEar Infections\r\nEar Injuries and Deformities\r\nEar Tubes\r\nVertigo & Motion Sickness', '2022-11-04 09:30:24'),
(88, 'The Nose', 'Care of the nasal cavity and sinuses is one of the primary skills of Otolaryngologists.', 15, '7988540.png', 'services we offer related to ear disorders include diagnosis and treatment for:\r\n\r\nNasal Disorders: \r\nallergies, fractures, nosebleeds, obstructions, postnasal drip, polyps, septum correction, stuffy nose, snoring\r\nSinus Disorders:\r\nsinusitis, bacterial infections, fungal infections', '2022-11-04 09:31:18'),
(89, 'The Throat', 'Communicating (speech and singing) and eating a meal all involve the throat. Otolaryngologists manage diseases of the throat, larynx, and the esophagus including voice and swallowing disorders.', 15, '4902797.png', 'Our services related to disorders of the throat\r\ninclude, but are not limited to:\r\n\r\nHoarseness, laryngitis\r\nVocal cord lesions\r\nSore throat\r\nTonsil and Adenoid Problems\r\nGastroesophageal Reflux (GERD)\r\nâLaryngopharyngeal Reflux (LPRD\r\nâLaryngeal cancer\r\nâThroat cancer', '2022-11-04 09:32:12'),
(90, 'The Head & Neck', 'This area of the body includes the important functions of sight, smell, hearing, and the appearance of the face. In the head and neck area, Otolaryngologists are trained to treat infections, benign and malignant tumors, facial trauma, and deformities of the face. They may also perform both cosmetic and reconstructive plastic surgery.', 15, '6824734.png', 'services we offer related to ear disorders include diagnosis and treatment for:\r\n\r\nThyroid Disorders: \r\nincluding over and under active glands, enlarged thyroid, tumors, and cancer\r\nHead & Neck Cancer', '2022-11-04 09:32:57'),
(91, 'Pediatric ENT Care', 'Our Otolaryngologists (ENT specialists) provide a full range of medical and surgical care tailored for children from newborns to teens for their Ear, Nose, Throat, and Head & Neck illnesses, disorders, and diseases', 15, '1834388.png', 'Treatments of :\r\nCongenital Deformities\r\nEaraches and infections\r\nEar tubes\r\nEar wax\r\nNasal allergies\r\nNosebleeds\r\nRecurrent sore throats\r\nSinus infections\r\nStrep throat\r\nTonsillitis', '2022-11-04 09:34:05'),
(92, 'Partial Knee Replacement', 'Partial Knee Replacement is done on patients with limited arthritis. If the Arthritis is more severe, then it calls for total knee replacement. If only a compartment or a portion of the knee is diseased or damaged and the other compartments have healthy cartilage and bone, then partial knee replacement also known as unicompartmental knee surgery is the ideal route of treatment. This will give you the relief you have been looking for and will permit you to maintain a more natural knee.  It is a knee replacement option that involves minimal invasion, less postoperative pain, less blood loss and less postoperative disease rate. This option is bone preserving and soft tissue friendly.', 19, '6760034.jpg', 'If you seek the quick return of function, a less recovery time and shorter hospital stay, partial replacement is particularly an attractive option.', '2022-11-04 09:38:30'),
(93, 'Total Knee Replacement', 'When there is substantial damage to the knee as a result of arthritis, trauma, injury, and other diseases that are destructive to the joints a total knee replacement surgery is advised. Total Knee replacement is a surgical procedure where damaged knee joint is replaced with artificial parts replaced with plastic or metal components. It is a procedure that aims at eliminating the excruciating pain and restoring maximum mobility and giving you the highest possible quality of life. Should you need a total Knee replacement, your doctor will decide on the surgical technique, and the type of implant is best for your medical condition.', 19, '4357106.jpg', 'The surgery takes 1 to 4 hours, and you can expect a hospital stay of 2 to 4 days depending upon your condition. Total Knee replacement requires post-operative therapy in the form of physiotherapy, special exercises, and regular checkups.', '2022-11-04 09:40:00');
INSERT INTO `doctor_services` (`id`, `name`, `description`, `speciality`, `coverpic`, `benefits`, `updated_on`) VALUES
(94, 'Hand and Wrist Surgery', 'Hand and Wrist Surgery is a vast orthopedic specialty. It encompasses treatment of medical conditions such as hand and wrist injuries, congenital anomalies, infections, degenerative changes of hand and wristâs structure, arthritis including osteoarthritis and rheumatoid arthritis. The human hand is an intricate instrument; Hence for undertaking a hand or wrist surgery, you need a doctor who specializes in treating wrists and hand. Some of the common types of hand surgery are closed reduction and fixation, carpal tunnel release, Dupuytrenâs contracture fasciectomy, joint arthrodesis, Trigger finger release, Tendon repair, Surgical drainage or debridement, Trapeziectomy, and Ganglion excision. Our hospital has a facility to undertake all kinds of surgeries of Hand & Wrist. We know that hand and wrist conditions can be extremely painful and frustrating. Early return to routine activities is aimed and emphasized. With the availability of our medical experts round the clock and convenient and rapid appointments, we aim to pace up your journey through consultation, diagnosis, treatment and rehabilitation.', 19, '6285952.jpeg', 'Our doctors specialize in Reconstructive microsurgery which makes them one of the best hand surgeons in India. Some of the benefits associated with hand and wrist surgery include improved wrist and hand function, long-term pain relief and enhanced appearance of your hand and wrist.', '2022-11-04 09:42:16'),
(95, 'Bone Fracture Treatment', 'In medical terms, a fracture is a medical condition in which the continuity of the bone is broken. At our trauma center in medicare hospital,Indore, we have immensely experienced orthopaedic doctors who successfully deal with a massive number of fracture and accident cases on a regular basis. The spectrum of their cases ranges from a single fracture to life-threatening musculoskeletal injuries. We carefully diagnose, and skillfully treat an array of fracture types. Some of them include hairline fracture, Impacted fracture, an Oblique fracture, Longitudinal fracture, Intraarticular fracture, Pathological fracture, Spiral fracture, Stress fracture, Torus fracture, Transverse fracture, Avulsion fracture,  compression fracture, Comminuted fracture, fracture dislocation, and Greenstick fracture. Most fractures happen caused by a massive fall or an accident. We adhere to international bone fracture treatment standards to treat our patients. Some of the symptoms of a fracture include swelling, bruising, excessive pain; incapability to move the impacted area, grating sensation, the inability of the patient to put any weight of the impacted area, bleeding, angulation, and discolored skin.', 19, '1654385.jpeg', 'If you experience any of the fracture symptoms, donât wait and simply contact our orthopedic experts and get the right diagnosis and treatments.', '2022-11-04 09:44:35'),
(96, 'Vascular Surgery', 'Vascular surgery involves the diagnosis and long-term care of problems of the arterial, venous, and lymphatic systems, excluding the cerebral and coronary arteries. A collaboration between different vascular surgeries requires extensive expertise to treat all kinds of vascular illnesses, including diagnostic, medical treatment, and reconstructive vascular surgical and endovascular methods. If you are going through vascular problems, consult a vascular surgeon near you.There are various types of vascular surgery, depending on the problem you have. Such surgeries are Angioplasty and Stenting, Deep Vein Occlusions, Arteriovenous (AV) Fistula, Arteriovenous (AV) Graft, Open Abdominal Surgery, Open Carotid and Femoral Endarterectomy, Thrombectomy, and Varicose Veins surgery. Vascular surgery can involve any part of the body.', 13, '633822.jpeg', 'Some of the conditions in which vascular surgery is beneficial include:\r\n\r\nIf you are going through aneurysm, it is beneficial. \r\nVascular surgery releases blood clots. \r\nIt helps cure carotid artery disease, veins disease, occlusive disease of the renal arteries, and so on.', '2022-11-04 09:50:40'),
(97, 'Heart Attack (Myocardial Infarction)', 'A heart attack (medically known as a myocardial infarction) is a deadly medical emergency where your heart muscle begins to die because it isnât getting enough blood flow. This is usually caused by a blockage in the arteries that supply blood to your heart. If blood flow isnât restored quickly, a heart attack can cause permanent heart damage and death.What happens during a heart attack? When a heart attack happens, blood flow to a part of your heart stops or is far below normal, which causes that part of your heart muscle to die. When a part of your heart canât pump because itâs dying from lack of blood flow, it can disrupt the pumping sequence for the entire heart. That reduces or even stops blood flow to the rest of your body, which can be deadly if it isnât corrected quickly.  What are the symptoms of a heart attack? Heart attacks can have a number of symptoms, some of which are more common than others. The symptoms you have are also influenced by your sex, as with men and women being more likely to have different heart attack symptoms.  Common heart attack symptoms Symptoms most often described by people having a heart attack:  Chest pain (angina). This symptom can be mild and feel like discomfort or heaviness, or it can be severe and feel like crushing pain. It may start in your chest and spread (or radiate) to other areas like your left arm (or both arms), shoulder, neck, jaw, back or down toward your waist. Shortness of breath or trouble breathing. Nausea or stomach discomfort. Heart attacks can often be mistaken for indigestion. Heart palpitations. Anxiety or a feeling of âimpending doom.â Sweating. Feeling lightheaded, dizzy or passing out.', 21, '1723227.jpg', 'there are several risk factors that you canât control, there are many ways you can help yourself and reduce your risk of a heart attack. These include:\r\n\r\nSchedule a checkup: Find a primary care provider and see them at least once a year for a checkup or wellness visit. An annual checkup can catch many of the early warning signs of heart disease, including signs that you can\'t feel. These include your blood pressure, blood sugar levels, cholesterol levels and more.\r\nQuit tobacco products: This includes smokeless tobacco and all vaping products.\r\nExercise regularly: Aim for 20 to 30 minutes of moderately intense physical activity a week.\r\nEat a healthy diet: Examples include the Mediterranean or Dash diets. A plant-based diet approach is an excellent alternative.\r\nMaintain a healthy weight: Your primary care provider can advise you on a healthy goal weight and provide you resources and guidance to help you reach that goal.\r\nManage your existing health conditions: This includes high cholesterol levels, high blood pressure and diabetes.\r\nReduce your stress: Consider techniques such as yoga, deep breathing and meditation.\r\nTake your medications: Donât just take medications when you remember to or when you have a doctorâs appointment coming up.\r\nKeep all your medical appointments: Seeing your healthcare providers regularly can help uncover heart-related issues or other medical problems you didn\'t know you had. This can also help treat problems sooner rather than later.', '2022-11-04 09:55:59'),
(98, 'Blood Clots', 'Blood clots are gel-like collections of blood that form in your veins or arteries when blood changes from liquid to partially solid. Clotting is normal, but clots can be dangerous when they do not dissolve on their own. Treatments range from medications to surgery.Some risk factors put certain people at higher risk for developing a blood clot.  Blood clots become more common as people get older, especially when they are over age 65. Long hospital stays, surgeries and trauma may significantly increase your risk of blood clots.  Other factors can increase your risk to a lesser degree. You might be more at risk if you:  Take birth control pills or hormone replacement therapy. Are pregnant. Have cancer, or have been treated for cancer. Have a family history of blood clots, or a specific condition, such as Factor V Leiden disease, antiphospholipid syndrome or polycythemia vera, that makes clots more likely. Have coronavirus disease 2019 (COVID-19). Some factors are based on lifestyle choices. Risks might be higher if you:  Have overweight/obesity. Live a sedentary (or inactive) lifestyle. Smoke cigarettes.', 21, '5565811.jpeg', 'You can reduce your risk of blood clots by:\r\n\r\nEnjoying regular physical activity.\r\nDo not smoke.\r\nEating a healthy diet and making sure that you stay hydrated.\r\nMaintaining a healthy weight.\r\nControlling medical problems such as high blood pressure and diabetes.\r\nMake sure you are up to date with cancer screening.', '2022-11-04 09:58:19'),
(99, 'Atrial Fibrillation (Afib)', 'Atrial fibrillation (Afib) is an irregular heart rhythm that begins in your heartâs upper chambers (atria). Symptoms include fatigue, heart palpitations, trouble breathing and dizziness. Afib is one of the most common arrhythmias. Risk factors include high blood pressure, coronary artery disease and having obesity. Untreated Afib can lead to a strokeYou might be wondering what Afib feels like. Some people with Afib have no symptoms. It depends on how fast your ventricles are beating. If theyâre beating at a normal or slightly elevated pace, you probably wonât feel anything. But if your ventricles beat faster then youâll start to notice symptoms. These can include:  Extreme fatigue. An irregular heartbeat. Heart palpitations. A feeling of butterflies or a fish flopping in your chest. Dizziness or lightheadedness. Fainting (syncope). Shortness of breath (dyspnea). Chest pain (angina). If you have symptoms, keep a list of when they happen and share this information with your healthcare provider right away.', 21, '5583302.jpeg', 'Here are some tips to lower your risk:\r\n\r\nFollow a heart-healthy diet.\r\nAdd aerobic exercise to your routine. Try for at least 150 minutes per week. Learn the target heart rate for your age and monitor your heart rate throughout exercise. Be sure to talk with your provider before starting any exercise plan.\r\nLimit your alcohol consumption.\r\nQuit smoking and using tobacco products. It can be hard to do this alone. With the right resources and support, you can achieve this goal and make your heart healthier.', '2022-11-04 10:00:02'),
(100, 'High Blood Pressure (Hypertension)', 'High blood pressure (hypertension) can be dangerous if itâs not treated. It can put you at risk for stroke, heart failure, kidney failure and other medical problems. Changing what you eat, exercising more and taking your medicine can help you keep your blood pressure where it should be.Category	Blood Pressure Normal	Under 130/80 mmHg Stage I Hypertension (mild)	130-139/OR diastolic between 80-89 mmHg Stage 2 Hypertension (moderate)	140/90 mmHg or higher Hypertensive Crisis (get emergency care)	180/120 mmHg or higher', 21, '141946.png', 'there are certain things you can do to help reduce your risk of developing high blood pressure. These include the following:\r\n\r\nEat right: A healthy diet is an important step in keeping your blood pressure normal. The DASH diet (Dietary Approaches to Stop Hypertension) emphasizes adding fruits, vegetables and whole grains to your diet while reducing the amount of sodium. Since itâs rich in fruits and vegetables, which are naturally lower in sodium than many other foods, the DASH diet makes it easier to eat less salt and sodium.\r\nKeep a healthy weight: Going hand-in-hand with a proper diet is keeping a healthy weight. Since being overweight increases your blood pressure, losing excess weight with diet and exercise will help lower your blood pressure to healthier levels.\r\nCut down on salt: The recommendation for salt in your diet is to have less than 1,500 milligrams of sodium a day (equal to about one teaspoon). To prevent hypertension, you should keep your salt intake below this level. Don\'t forget that most restaurant foods (especially fast foods) and many processed and frozen foods contain high levels of salt. Use herbs and spices that do not contain salt in recipes to flavor your food; do not add salt at the table. (Salt substitutes usually have some salt in them.)\r\nKeep active: Even simple physical activities, such as walking, can lower your blood pressure (and your weight).\r\nDrink alcohol in moderation: Having more than one drink a day (for women) and two drinks a day (for men) can raise blood pressure.', '2022-11-04 10:02:25'),
(101, 'High Blood Cholesterol', 'Cholesterol really matters. How much you ask? For every one percent decrease in your cholesterol, your risk of developing heart disease decreases by two percent.  Thatâs why itâs important for you to lower high cholesterol whether you are looking to prevent heart disease or are trying to prevent any further damage following a heart attack.', 56, '2023949.jpeg', 'Your goal should be:\r\nTotal cholesterol (a measure of HDL, LDL and other lipoproteins)\r\nLess than 200 mg/dL\r\nTriglycerides\r\nLess than 150 mg/dL\r\nLDL (Low-density lipoprotein)\r\nLess than 130 mg/dL\r\nLess than 100 mg/dL for those with heart or blood vessel disease and for those with diabetes or high total cholesterol\r\nHDL (High-density lipoprotein)\r\nGreater than 55 mg/dL (females)\r\nGreater than 45 mg/dL (males)', '2022-11-04 10:04:21'),
(102, 'Diabetes', 'Does an endocrinologist treat diabetes? YES. Diabetologist is an endocrinologist who especially treats metabolic disorders like diabetes and its complications.  According to recent statistics, diabetes is the most common endocrine disorder in India. About 11.8% of the Indian population suffers from diabetes with 72.96 million registered cases.  Type 2 diabetes called diabetes mellitus or adult- onset diabetes is the commonest form of diabetes. About 2.4% of the rural population and 11.6% in urban population is known to suffer from type 2 diabetes.  Insulin resistance and the inability of the pancreas to produce enough insulin lead to elevated blood sugars.  Type 1 diabetes or diabetes insipidus is insulin- dependent diabetes. It is due to the bodyâs destruction of its own insulin-producing cells in the pancreas. The treatment is done by regular insulin injections or an insulin pump.  Gestational Diabetes that develops in some females during their pregnancy. Obstetrician/gynecologists should screen women for gestational diabetes at 24-28 weeks of pregnancy and refer them to an endocrinologist.  Juvenile Diabetes commonly seen in some children aged 4 to 7 years and between 10 to 14 years old also require immediate medical attention.', 14, '9706763.jpeg', 'Helps in controlling Diabetes.', '2022-11-04 10:13:23'),
(103, 'Thyroid Disorders', 'The thyroid is a butterfly-shaped gland which produces the hormones T4 and T3. Thyroid hormone affects all organ systems of the body.  Disorders of the thyroid gland are either low thyroid level  called hypothyroidism or high thyroid level called hyperthyroidism.  Endocrinologists also diagnose and manage conditions like thyroid nodules and thyroid cancer', 14, '2294613.jpeg', 'Better Treatment of thyroid disorders.', '2022-11-04 10:14:41'),
(104, 'Osteoporosis', 'Osteoporosis is characterized by low bone density and deterioration of bone structure. The bones become fragile and become much more prone  to fractures. It can happen in both females and males.  Parathyroid hormone osteoporosis is caused by over secretion of PTH, which leads to calcium leaching from the bones and making them weaker.  All osteoporotic patients must consult an endocrinologist for proper treatment and precautionary guidelines.', 14, '7577009.jpeg', 'Proper treatment and precautionary guidelines.', '2022-11-04 10:15:56'),
(105, 'Polycystic Ovarian Syndrome (PCOS)', 'PCOS affects about 22.5% of the female population in India. It majorly occurs due to an unhealthy lifestyle leading to unilateral or bilateral polycystic ovaries. An imbalance in the male and female reproductive hormones in womenâs bodies in the reproductive age is noted. If females experience irregular or or absence of menstrual periods, rapid weight gain and excess body and facial hair, they must consult an endocrinologist soon. Endocrinologists specializing in female hormones can help them manage PCOS and infertility too.', 14, '7846771.jpeg', 'Endocrinologists specializing in female hormones can help them manage PCOS and infertility too.', '2022-11-04 10:17:30'),
(106, 'Adrenal gland disorders', 'The adrenal glands are pyramid shaped glands sitting above each kidney. They produce steroid hormones, cortisol and aldosterone.  Disorders of the adrenal glands occur due to abnormal levels of the above steroid hormones. Cushing\'s syndrome is due to excessive hormone secretion.  Endocrinologists can prescribe CT and MRI scans to confirm adrenal masses known as adrenal incidentalomas.', 14, '4082384.jpeg', 'Our team of expert endocrinologists at BAGH will carefully review your medical history, current medical problems, perform a physical exam, and check your hormonal profile and prescribe an effective treatment.', '2022-11-04 10:18:50');
