(2, 4, 'drrajat', '', '', '', '', 'https://g.page/r/CSkueWYjBTNyEBE/review', 'Treatment of fractures and other injuries in children\r\nViral Fever Treatment\r\nNew Born Care\r\nDevelopment Assessment\r\nTonsillitis Treatment\r\nInfectious Disease Treatment\r\nCongenital Disorders Evaluation / Treatment\r\nGrowth & Development Evaluation / Management\r\nHealth Checkup (Pediatric)\r\nAllergy Testing\r\nMalaria Treatment\r\nFever Treatment\r\nMeasles Treatment\r\nJaundice Treatment\r\nCough Treatment', 'Dr. Puneet is working as a senior consultant in the Department of Pediatrics and Pediatric Gastroenterologist. He has over 10 years of experience in the Department of Pediatrics, which includes treating of various childhood disorders and neonatal diseases.', 1, '2022-09-01 08:56:46', '2022-09-01 07:18:41', 1, '20 MIN', 7, 1, 800.00, '15 MIN', 7, 1, 500.00, '10 MIN', 7, 1, 1000.00),
(3, 6, 'drladli', 'https://m.facebook.com/VianKaberiRebati/?ref=py_c', '', '', '', 'https://g.page/r/CVYiMTOHG1i0EB0/review', 'Dr. Ladli Chatterjee is a Internal Medicine and General Physician in Gurgaon Sector 45, Gurgaon and has an experience of 8 years in these fields. Dr. Ladli Chatterjee practices at VKaRe Clinic in Gurgaon Sector 45, Gurgaon and Profrea Multispeciality Clinic in South City-I, Gurgaon. She completed MBBS from Dr. D Y Patil University in 2014 and MD - General Medicine from Dr. D Y Patil University in 2018.\r\n\r\nSome of the services provided by the doctor are: Diabetes in Children,Cough Treatment,Lower/Upper Respiratory Tract Infection Treatment,Typhoid Fever Treatment and Vaccination/ Immunization etc.', 'She completed MBBS from Dr. D Y Patil University in 2014 and MD - General Medicine from Dr. D Y Patil University in 2018.', 1, '2022-10-08 10:43:35', '2022-09-13 05:46:49', 1, '10 MIN', 7, 1, 1.00, '5 MIN', 7, 1, 800.00, '5 MIN', 7, 1, 800.00),
(6, 10, 'cloudi5teams', '', '', '', '', '', '', '', 1, '2022-09-16 11:23:14', '2022-09-16 11:18:17', 1, '5 MIN', 8, 1, 800.00, '10 MIN', 8, 1, 450.00, NULL, 1, 0, 0.00),
(7, 12, 'drgul', '', '', '', '', 'https://g.page/r/CSwgumNeQKq1EB0/review', 'Dr. Gul Ayat is a Internal Medicine and General Physician in Gurgaon and has an experience of 10 years in these fields. Dr. Gul Ayat practices at Gurgaon and Profrea Smart Clinic in South City-I, Gurgaon. . Some of the services provided by the doctor are: Diabetes, Sleep Studies, Cough Treatment, Lower/Upper Respiratory Tract Infection Treatment, Typhoid Fever Treatment and Vaccination/ Immunization etc.', '', 1, '2022-10-08 08:26:55', '2022-09-20 11:19:56', 1, '10 MIN', 5, 1, 800.00, '10 MIN', 5, 1, 800.00, '10 MIN', 5, 1, 800.00),
(8, 16, 'drshrey', '', '', '', '', 'https://g.page/r/CSkueWYjBTNyEB0/review', 'Dr. Shrey Jain, MBBS, MS, Mch Urolgy, is a highly qualified and experienced urologist in gurgaon and delhi NCR Region. He is an associate consultant in Urology and Kidney Transplant department at Fortis Memorial Research Institute. Dr. Shrey has been associated with many prestigious organizations like King George Medical University, Lucknow, Sanjay Gandhi Post Graduate Institute, Lucknow. He is easily approachable, very polite in nature and gives priority to his patients over anything else. Having done his super specialization from one of the leading urology institutes and is well versed with all the latest treatments in urology including robotic surgery and renal transplant. He has a keen interest in urology cancers (kidney, bladder, prostate, testis and penile) and endourology dealing with kidney stones, urethral strictures and bladder tumors. He takes keen interest in educational activities and research. He is currently practicing at Profrea Smart Clinic,South City1,Gurgaon.', '', 1, '2022-10-11 18:57:49', '2022-09-27 08:43:03', 1, '10 MIN', 7, 1, 1.00, '10 MIN', 7, 1, 800.00, '10 MIN', 5, 1, 700.00),
(9, 18, 'drarchita', '', '', '', '', 'https://g.page/r/CTV10Y9kt1-xEB0/review', 'Dr. Archita\'s Homoeo helps patients with their mental and physical ailments in the most natural manner without interfering much with the internal sacred sanctity of the inner vital immunity of the patient.', '', 1, '2022-10-12 14:37:47', '2022-10-08 07:03:57', 1, '10 MIN', 4, 1, 900.00, '10 MIN', 5, 1, 900.00, '10 MIN', 7, 1, 900.00),
(10, 7, 'aayushdhi', '', '', '', '', 'https://g.page/r/CYhaVKekjcLJEB0/review', 'Dr Gauri Verma ,MD Homeopathy, is dedicated to the diagnosis and treatment of every type of chronic and acute illness. It is a podium for people coming up with queries and opinions about their diseases and problems be it physical or psychological. Her consultation has helped in managing stress and depression with medicine and counseling, improving the vision, allergies, childhood asthma, Removal of warts, gynecological troubles, arthritis, stones etc', '', 1, '2022-10-11 14:39:05', '2022-10-08 07:11:18', 1, '10 MIN', 5, 1, 500.00, '10 MIN', 4, 1, 500.00, '10 MIN', 4, 1, 500.00),
(11, 19, 'fineally', '', '', '', '', 'https://g.page/r/CQLzA2l3E0l0EB0/review', 'Archita is a counselling psychologist with 7 years of experience in the field of mental health. She uses an eclectic approach to promote well-being of each unique individual. She believes that inclusion and acceptance can lead to wholeness at individual and societal levels.', '', 1, '2022-10-13 11:20:52', '2022-10-08 07:17:57', 1, '60 MIN', 7, 1, 2250.00, '60 MIN', 7, 1, 2250.00, '60 MIN', 7, 1, 2250.00),
(12, 20, 'purekids', 'https://www.facebook.com/drsudeipchaudhry/', '', '', '', 'https://www.facebook.com/drsudeipchaudhry/', 'Dr. Sudip Chowdhury is a Senior Consultant in Paediatrics and Neonates with more than 15 years of experience. He did his training in Paediatrics from the Royal College of Paediatrics and Child health ( London, UK) and was awarded the prestigious MRCPCH (Royal College of Paediatrics and Child Health, UK). After returning to India from the UK in 2019, he was part of the team responsible for establishing a Paediatric Intensive Care Unit at Columbia Asia Hospitals, Gurugram. He is currently Senior Consultant in the Department of Paediatrics at Columbia Asia Hospital, Palam Vihar Gurgaon, where he runs General Paediatric and Paediatric Endocrine OPDs, Endocrine Day care and Paediatric In-patient serrvices.\r\n\r\nDr. Sudip Chowdhury has worked at some of the finest Paediatric and Newborn centers in the UK including The Great Ormond Street Hospital for Children, London, Royal Hospital for Sick Children, Glasgow and Leeds Teaching Hospitals NHS trust, Leeds, UK. He obtained the Membership of the Royal College of Paediatrics and Child Health after 2 years of Paediatric training in England and Wales. He has received specialist Paediatric Endocrine training in Leeds Paediatric Rotation. He has been awarded the prestigious Edward Jenner award for exemplary work done in Clinical Leadership. Besides General and Adolescent Pediatrics, Dr Sudip Chowdhury is interested in Pediatric Endocrinology (hormonal issues in Children), Growth and Development, Immunizations and infectious diseases. His expertise lies in diagnosing faltering growth in children, diagnosis and treatment of childhood obesity, treating early or late puberty among others. He has also been associated with improving process flows in secondary and tertiary care hospitals ( Lean Six Sigma champion) as well as the recipient of \'good communications skills\' award in the United Kingdom (2018). His Patients know him for his listening ability, diagnosing complex conditions and amazing communication skills. He has presented in various International Symposiums and conferences and has peer reviewed publications to his credit.', '', 1, '2022-10-13 11:54:06', '2022-10-08 07:25:45', 1, '15 MIN', 7, 1, 799.00, '10 MIN', 7, 1, 799.00, '5 MIN', 1, 1, 799.00),
(13, 21, 'dieticiankamal', '', '', '', '', 'https://g.page/r/CdzUYXecJHZSEB0/review', 'Diet for a Healthy Skin ,Nutrition Counseling in Hairfall,Heat Therapy Treatment,Diet Counselling,Post Covid Nutrition Plan, Immunity Boosting and Nutrition Diet ,Diabetes Management, Diabetic Diet ,Counseling Diet ,Therapy Diet For Kids, Hypertension Diet, Counselling Behavioral Nutrition, Weight Gain Diet, Counseling Coaching for Weight Loss ,Nutrition for Pregnant Women ,Pre and Post Delivery Care and others.', 'A specialist in Dietetics and Clinical Nutrition with a rich experience of over 8 years is currently working in Medanta Hospital. She has also participated in various workshops, delivered numerous presentations and published many papers. She is known for attention to detail, accurate diagnosis and treating patients with empathy. \r\n \r\nConnect to Dt Kamal Yadav for priority appointments and a hassle-free experience via Profrea Smart Clinic.', 1, '2022-10-13 12:20:47', '2022-10-08 07:35:00', 1, '30 MIN', 7, 1, 1000.00, '30 MIN', 7, 1, 1000.00, '15 MIN', 7, 1, 1000.00),
(14, 22, 'dtsilver', '', '', '', 'https://www.instagram.com/dieticiansilversethi/?hl=en', '', 'Lifestyle correction, diabetes management, weight loss, hormone balancing, muscle gain, pregnancy, postpartum weight management, stress eating, kids nutrition. Senior care nutrition, obesity control, strength and vitality, skin care, balanced nutrition and others services.', 'Dietician Silver Sethi is a practicing consultant nutritionist and dietician from Gurgaon. She transforms lives by providing holistic, all natural diets aiming at an overall metabolic boost and a disease free, healthy lifestyle. Passionate towards health and fitness, she left the corporate world to persue a successful career in nutrition science n dietitics. Her USP is her smart diets which are client centric, easy to follow and result oriented. Her knowledge and dedication towards nutrition and health has led to many motivated, happy and transformed clients online and across NCR.Ãâ  After consultation, Silver shares four weekly variable diet schedules based on her analysis of the client\'s goals, lifestyle, and other aspects. Her consultation duration is 30-minutes.', 1, '2022-10-13 13:17:23', '2022-10-08 07:42:12', 1, '25 MIN', 7, 1, 1500.00, '30 MIN', 7, 1, 1500.00, '25 MIN', 7, 1, 1500.00),
(15, 23, 'drsiddharth', '', '', '', '', '', 'ENT Checkup (General)\r\nNasal Endoscopy\r\nNasal Disorders\r\nNasal Septum Surgery\r\nFracture Nasal Bone Correction\r\nNasal Polypectomy\r\nFunctional Endoscopic Sinus Surgery - FESS\r\nSalivary Gland Surgery\r\nVocal Cord Surgery\r\nSinus Surgery\r\nSurgery for Snoring\r\nMicroscopic Voice Surgery\r\nReconstructive Middle Ear Surgery\r\nEar Reconstructive Surgery\r\nEardrum Rupture Treatment', 'Dr. Siddharth Vashistha is an ENT Surgeon and has surgery experience of 10 years in this field. Dr. Siddharth Vashistha practices at n. Previously, he worked at Indraprastha Apollo Hospital, New Delhi. Dr. Siddharth Vashistah is also a visiting Consultant at Columbia Asia Hospital.\r\n\r\nHe specialises in Micro Ear Surgeries, Endoscopic Sinus Surgery, Endoscopic Septoplasty, Vocal Cord Surgery, Surgery for Snoring and Sleep Apnoea.\r\n\r\nHe has a keen interest in ENT surgeries and likes to keep himself updated with the latest in the ever evolving field of surgery. He is currently working as ENT He likes to attend various workshops and conferences across India to keep himself updated with various Advancements in the field of ENT Surgery.', 1, '2022-10-13 13:40:54', '2022-10-08 07:48:53', 1, '15 MIN', 7, 1, 1000.00, '25 MIN', 7, 1, 1000.00, '20 MIN', 7, 1, 1000.00),
(16, 24, 'drvinit', '', '', '', '', 'https://g.page/r/CTFGRVTqTsM-EB0/review', 'Dr. Vinit Sanjeev had done MBBS,MD Psychiatry & Consultant Psychiatrist, Neuropsychiatrist, Sexologist', '', 1, '2022-10-14 06:50:12', '2022-10-11 10:42:15', 1, '30 MIN', 7, 1, 1000.00, '30 MIN', 7, 1, 1000.00, '45 MIN', 7, 1, 1000.00),
(17, 26, 'drpragya', '', '', '', '', '', 'Dr. Pragya Punj is a Genuine, reliable and patient-focused Dermatologist with ample experience in managing OPD and performing minor surgical procedures in high volume settings. Adept at diagnosing and treating a myriad of skin diseases. Skilled in Radio Cautery, Electro Cautery, PRP and mesotherapy, Chemical Peels, LASERS (Laser Hair Removal, Q Switched Nd -Yag Laser, Diode and CO2 ablative and fractional Lasers), excisions and biopsies (sebaceous cysts removal, nail avulsion, mole removal and scar revision, ear lobe repair), cosmetic procedures (Vampire facial, HydraFacial, MNRF, BB Glow). Good interpersonal skills with profound communication. [shrink]', '', 1, '2022-10-14 10:24:46', '2022-10-14 10:16:04', 1, '15 MIN', 7, 1, 1000.00, '15 MIN', 7, 1, 1000.00, '15 MIN', 7, 1, 1000.00),
